script: |
  super -f text -I q1232.spq | sort > q1232.out

inputs:
  - name: q1232.spq
    data: |
      SELECT DISTINCT - col0 + - - CAST ( - col0 AS INTEGER ) AS col2 FROM tab0 (FORMAT parquet) WHERE NOT + CAST ( col2 AS REAL ) IS NOT NULL;
  - name: tab0

outputs:
  - name: q1232.out
    data: |
